import React from 'react';

function Footer() {
  return (
    <footer className="footer-container">
      <div className="footer-nav">
        <li>item 1</li>
        <li>item 2</li>
        <li>item 3</li>
        <li>item 4</li>
        <li>item 1</li>
      </div>
    </footer>
  );
}

export default Footer;
